import Card from './Card';


const Deck = () => {
    let deck = []

    const createDeck = () => {
        for (let i = 2; i < 100; i++) {
            deck.push(new Card(i))
        }
    }

    return (
        <div className="deck"> Deck
        </div>
    )
}

export default Deck;
